import React, {Component} from "react";
import { createClient } from "../converters/clientConverter";

//css
import "../assets/css/Login.css";
import logo from '../assets/images/LOGOPRO.png';
import {Apiurl} from '../services/apirest';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import  {Link} from 'react-router-dom';
import swal from "sweetalert";

class Register extends Component{


    constructor(props){
        super(props);
    }


    state={
        form:{
            "name": "",
            "birthdate": "",
            "email": "",
            "password": "",
            "code": ""    

        },
        error:false,
        errorMsg:""
    }




    manejadorSubmit = e => {
        e.preventDefault();
    }


    manejadorChange = async e => {
            await this.setState({
                form:{
                    ...this.state.form,
                    [e.target.name]: e.target.value
                }
            })
         
    }


    

    post = () => {
        let url = ("https://siglo-xxi-users.azurewebsites.net/Users/v1/users");
        const body = createClient(this.state.form);
        axios
          .post(url, body)
          .then((response) => {
            
          swal(
            'Bienvenido',
            'Ya puedes iniciar sesión',
            'success' 
        )
        
            this.props.history.push("/");
          })
          .catch((error) => console.log(error.response.data));
      };



    
    render(){

        return(
               
        <React.Fragment>

                    <div id="fondito" className="wrapper fadeInDown">
                        
                    <div id="formContent">
                    <h7><strong>Registrarte</strong></h7>        
                        <p>Es rápido y fácil.</p>

                        <div className="fadeIn first">
                    

                   

                 <div className="row">
                      <div className="col-bg-8">
                     <label className="col-md-8 control-label">Correo&nbsp;electrónico</label>
                     <div className="col-bg-6">
                         <input className="form-control" name="email" placeholder="Ingresa tu correo electrónico" type="email" id="correito" 
                         onChange={this.manejadorChange}
                
                         
                         />
                       </div>
                </div>
                 </div>
                 <br/>


                        <div className="row">
                      <div className="col-bg-8">
                     <label className="col-md-8 control-label">Nombre</label>
                     <div className="col-bg-6">
                         <input className="form-control" name="name" placeholder="Ingresa tu nombre" type="text"  maxLength={20}
                         onChange={this.manejadorChange}
                         onKeyPress={(e) => this.fourthMethod(e)}
                         
                         />
                       </div>
                </div>
                 </div>
                 <br/>



                 <div className="row">
                      <div className="col-bg-8">
                     <label className="col-md-8 control-label">Fecha&nbsp;de&nbsp;nacimiento</label>
                     <div className="col-bg-6">
                         <input className="form-control" name="birthdate"  type="date" id="correito"
                         onChange={this.manejadorChange}
                         
                         />
                       </div>
                </div>
                 </div>
                 <br/>




                 <div className="row">
                      <div className="col-bg-8">
                     <label className="col-md-8 control-label">Contraseña</label>
                     <div className="col-bg-6">
                         <input className="form-control" name="name" placeholder="Crea tu contraseña" type="password"  maxLength={50}
                         onChange={this.manejadorChange}
                         
                         />
                       </div>
                </div>
                 </div>
                 <br/>

                 <input id="iniciarsesion" type="submit" className="fadeIn fourth" value="Iniciar Sesión" onClick={this.manejadorBoton}/>










                        </div>

                      

                    </div>
                    </div>

                   
        </React.Fragment>
        
               
        );
    }

}


export default Register;
